let setSeptikkpumpetid = null;
let setSeptikkpumpepausetid = null;
let setBrukstankHNivaaIProsent = null;
let setBrukstankLLNivaaIProsent = null;
let setO2Intervall = null;
let setO2Runtime = null;
let setO3Runtime = null;
let setO3Disabled = null;
let setO3SensorNullNivaa = null;
let setBuzzerDisabled = null;
let setMaksverdiSeptikkAN = null;
let setMinimumsnivaaSeptikkProsent = null;
let setMaksverdiBruksvannAN = null;
let setMinimumsnivaaBruksvannProsent = null;
let setLat = null;
let setLon = null;
let setSSID = null;
let setWifiPassword = null;


// Command (cmd)
if ((msg.payload.cmd === "Status") || (msg.payload.cmd === "status") || (msg.payload.cmd === "STATUS")) {
    getStatus = true;
} else if ((msg.payload.cmd === "Konfig") || (msg.payload.cmd === "konfig") || (msg.payload.cmd === "KONFIG")
    || (msg.payload.cmd === "Config") || (msg.payload.cmd === "config") || (msg.payload.cmd === "CONFIG")) {
    getConfig = true;
} else if ((msg.payload.cmd === "Pos") || (msg.payload.cmd === "pos") || (msg.payload.cmd === "POS")
    || (msg.payload.cmd === "gps") || (msg.payload.cmd === "GPS")) {
    getPos = true;
}

