    setO3bobler = 0;
}

// Septikkpumpetid
if (msg.payload.Septikkpumpetid !== undefined) {
    setSeptikkpumpetid = msg.payload.Septikkpumpetid;
}

// Septikkpumpepausetid
if (msg.payload.Septikkpumpepausetid !== undefined) {
    setSeptikkpumpepausetid = msg.payload.Septikkpumpepausetid;
}

// BrukstankHNivaaIProsent
if (msg.payload.BrukstankHNivaaIProsent !== undefined) {
    setBrukstankHNivaaIProsent = msg.payload.BrukstankHNivaaIProsent;
}

// BrukstankLLNivaaIProsent
if (msg.payload.BrukstankLLNivaaIProsent !== undefined) {
    setBrukstankLLNivaaIProsent = msg.payload.BrukstankLLNivaaIProsent;
