if (msg.payload.O3SensorNullNivaa !== undefined) {
    setO3SensorNullNivaa = msg.payload.O3SensorNullNivaa;
}

// MaksverdiSeptikkAN
if (msg.payload.MaksverdiSeptikkAN !== undefined) {
    setMaksverdiSeptikkAN = msg.payload.MaksverdiSeptikkAN;
}

// MinimumsnivaaSeptikkProsent
