    setLon = msg.payload.Lon;
}

// SSID
if (msg.payload.SSID !== undefined) {
    setSSID = msg.payload.SSID;
}

// WifiPassword
if (msg.payload.WifiPassword !== undefined) {
    setWifiPassword = msg.payload.WifiPassword;
}


