    { payload: setO3bobler },
    { payload: setSeptikkpumpetid },
    { payload: setSeptikkpumpepausetid },
    { payload: setBrukstankHNivaaIProsent },
    { payload: setBrukstankLLNivaaIProsent },
    { payload: setO2Intervall },
    { payload: setO2Runtime },
    { payload: setO3Runtime },
    { payload: setO3Disabled },
    { payload: setO3SensorNullNivaa },
    { payload: setBuzzerDisabled },
    { payload: setMaksverdiSeptikkAN },
    { payload: setMinimumsnivaaSeptikkProsent },
    { payload: setMaksverdiBruksvannAN },
    { payload: setMinimumsnivaaBruksvannProsent },
    { payload: setLat },
    { payload: setLon },
    { payload: setSSID },
    { payload: setWifiPassword }
];

let lastTimer = global.get("lastTimer");
let newTimer = global.get("MB01TimerInput");

global.set("lastTimer",newTimer);

//return { payload: Math.round(100 * global.get("MB01TimerInput") / 240) / 100 }; 
return [
    { payload: newTimer },
    { payload: ((newTimer - lastTimer) != 0 ? (newTimer - lastTimer):0)}
];
